INSERT INTO `wp_term_taxonomy` VALUES (1,1,'category','',0,1),(2,2,'tnc_tax_27','Objetos usados na caça, tiro ao alvo, guerra ou proteçao pessoal. Exclui equipamento projetado para o transporte de tropas e suprimentos, indumentária e respectivos acessórios.Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0),(3,3,'tnc_tax_27','Objetos usados na conservação, manutenção e funcionamento das armas. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',2,0),(4,4,'tnc_tax_27','Inclui, também, as de treinamento. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',2,0),(5,5,'tnc_tax_27','Objetos usados na proteção do corpo do homem e do animal, em situações de combate. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',2,0),(6,6,'tnc_tax_27','Inclui, também, as de treinamento. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',2,0),(7,7,'tnc_tax_27','Exclui armas. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',2,0),(8,8,'tnc_tax_27','Objetos criados, geralmente, com fins estéticos ou como demonstração de criatividade e que integram as artes gráficas, plásticas e cinematográfica. Exclui a fotografia e respectivas cópias fotomecânicas. Ver também COMUNICAÇÃO, EQUIPAMENTO DE ARTES DO ESPETÃCULO e EQUIPAMENTO DE ARTISTAS/ARTESÃOS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0),(9,9,'tnc_tax_27','Objetos que não são considerados propriamente pinturas e esculturas, para fins de classificação, mas, que se assemelham às mesmas e que apresentam em suas estruturas elementos pré-fabricados, amostras minerais e vegetais, mecanismos, luz, movimento etc. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.\" Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',8,0),(10,10,'tnc_tax_27','',8,0),(11,11,'tnc_tax_27','',8,0),(12,12,'tnc_tax_27','Imagens, sobre papel, resultantes das técnicas de gravura e/ou impressão. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',8,0),(13,13,'tnc_tax_27','',8,0),(14,14,'tnc_tax_27','',8,0),(15,15,'tnc_tax_27','Objetos relativos a dinheiro ou representativos de dinheiro, bem como aqueles que servem de instrumento para obtenção de serviços bem definidos (ex. :moeda, selo postal, vale etc.).  Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0),(16,16,'tnc_tax_27','Construções criadas para atender a qualquer necessidade humana em local relativamente permanente. Inclui os respectivos fragmentos. Ver também INTERIORES. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0),(17,17,'tnc_tax_27','Usar apenas quando o abrigo como um todo é catalogado. Inclui os frágeis e portáteis (ex.: casa, mausoléu, capela, estábulo, casa de cachorro, barraca etc,). Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',16,0),(18,18,'tnc_tax_27','Aquelas criadas para servir a alguma necessidade humana que não a de abrigo e desassociadas de edifícios (ex.: chafariz, ponte etc.). Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',16,0),(19,19,'tnc_tax_27','Objetos existentes, em geral, dentro de edifícios, conectados de forma mais ou menos permanente ao sistema de água e esgoto. Inclui os respectivos acessórios. Ver também FRAGMENTO DE CONSTRUÇÃO.  Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',16,0),(20,20,'tnc_tax_27','Objetos criados para ser parte de uma construção ou acessórios para seu funcionamento (ex: telha, tijolo, porta, dobradiça etc.). Ver tambérn EQUIPAMENTO HIDRÁULICO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',16,0),(21,21,'tnc_tax_27','Objetos usados no interior ou em torno de edifícios, com o propósito de proporcionar conforto, cuidado prazer aos seus ocupantes. Ver também - CONSTRUÇAO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0),(22,22,'tnc_tax_27','Objetos usados dentro ou em torno de um edifício com propósitos utilitários relativamente menores, ou então quando não se enquadram nas demais subclasses do item 05. Exclui ARTIGO DE TABAGISMO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',21,0),(23,23,'tnc_tax_27','Objetos criados para modificar a temperatura e a umidade de um ambiente fechado. Inclui os respectivos acessórios (ex.: ventilador, guarda-fogo etc.). Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',21,0),(24,24,'tnc_tax_27','Objetos usados na limpeza de recintos e na lavagem de roupa, sejam esses serviços realizados em edifícios públicos ou privados. Ver também TRABALHO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',21,0),(25,25,'tnc_tax_27','Inclui os respectivos acessórios e instalações especializadas, tais como iluminaçao de rua, de jardim e aparelhos de iluminaçao teatral. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',21,0),(26,26,'tnc_tax_27','Inclui todo tipo de mobiliário. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',21,0),(27,27,'tnc_tax_27','Objetos usados no preparo, guarda, serviço ou consumo de alimentos e bebidas. Inclui, também, aparelhos (ex.: fogão, geladeira etc.). Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',21,0),(28,28,'tnc_tax_27','Objetos usados pelo homem nas suas atividades de trabalho. Não se diferenciou trabalho de hobby. Exclui mobiliário e indumentária profissionais. Ver também COMUNICAÇÃO, EQUIPAMENTO DE SERVIÇOS DOMÉSTICOS e MEDIÇÃO/REGISTRO/OBSERVAÇÃO/PROCESSAMENTO Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0),(29,29,'tnc_tax_27','Objetos usados no cultivo do solo com culturas permanentes ou temporárias, inclusive hortaliças e flores. Inclui, ainda, o equipamento utilizado na produção de alimentos e bebidas, jardinagem, extração vegetal, silvicultura e reflorestarnento. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',28,0),(30,30,'tnc_tax_27','Objetos usados na produção de música e respectivos acessórios. Ver também EQUIPAMENTO DE ARTISTAS/ARTESÃOS e EQUIPAMENTO DE COMUNICAÇÃO SONORARA/VISUAL. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',28,0),(31,31,'tnc_tax_27','Equipamento de trabalho mecânico ou eletrônico que não se enquadra nas demais subclasses do item 06. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',28,0),(32,32,'tnc_tax_27','Objetos usados na captura de peixes, crustáceos e moluscos. Exclui embarcações e armas. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',28,0),(33,33,'tnc_tax_27','Objetos usados durante a realização de espetáculos teatrais, de dança, ópera, circo e de filmagens. Exclui indumentária, adornos, mobiliário e objetos de iluminação. Ver também ARTES VISUAIS/CINEMATOGRÁFICA e EQUIPAMENTO DE ARTISTAS/ARTESÃOS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',28,0),(34,34,'tnc_tax_27','Ver também ARTES VISUAIS/CINEMATOGRÁFICA, EQUIPAMENTO DE ARTES DO ESPETÁCULO, EQUIPAMENTO DE FIAÇÃO/TECELAGEM e INSTRUMENTO MUSICAL. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',28,0),(35,35,'tnc_tax_27','Objetos usados na venda de mercadorias e serviços. Ver também MATERIAL DE PROPAGANDA. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',28,0),(36,36,'tnc_tax_27','Objetos usados no fabrico de fios, linhas ou cordas, ou na manufatura de tecidos ou de objetos de fibras naturais e sintéticas. Inclui os instrumentos utilizados na costura e cestaria. Ver também EQUIPAMENTO DE ARTISTAS/ARTESÃOS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',28,0),(37,37,'tnc_tax_27','Objetos usados na extração mineral, seja ela subterrânea ou de superfície. Inclui, também, equipamento de prospecção. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',28,0),(38,38,'tnc_tax_27','Objetos usados na criação, recriação, engorda e domesticação de animais, bem como os utilizados na transformação e beneficiamento de produtos animais. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',28,0),(39,39,'tnc_tax_27','Objetos usados em diversas atividades profissionais. Inclui, também, os utilizados na construção civil. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',28,0),(40,40,'tnc_tax_27','Objetos usados no exame, teste, diagnóstico e tratamento do ser humano e de animais. Inclui o equipamento de dentistas e farmacêuticos, bem como o utilizado pela medicina popular. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',28,0),(41,41,'tnc_tax_27','Objetos criados para servir de brinquedo ou serem usados em jogos, sorteios, atividades esportivas etc. Exclui indumentária e mobiliário. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0),(42,42,'tnc_tax_27','Objetos usados como sinais distintivos,individuais ou coletivos, de função, dignidade, posto,comando, poder, nobreza, nação etc. Inclui os respectivos acessórios e exclui mobiliário e indumentária.Ver também OBJETOS CERIMONIAIS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0),(43,43,'tnc_tax_27','Objetos usados em cerimônias e/ou rituais conduzidos de forma sistemática e geralmente prescrita, sejam eles civis, religiosos ou militares. Exclui instrumentos musicais, mobiliário e indumentária. Ver também INSÍGNIAS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0),(44,44,'tnc_tax_27','Objetos usados em cerimônias promovidas por instituições, públicas ou privadas, civis ou militares. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',43,0),(45,45,'tnc_tax_27','Objetos cuja função principal é homenagear pessoas e lugares, ou comemorar eventos, e que, geralmente, não cumprem função utilitária. Objetos com função utilitária definida, mas que contêm decoração de caráter comemorativo, serão incluídos nas respectivas classes (ex.: vaso comemorativo pertence à subclasse ACESSÓRIO DE INTERIORES). Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',43,0),(46,46,'tnc_tax_27','Objetos usados em cerimônias de culto e rituais de diversas religiões. Ver também OBJETO DE DEVOÇÃO PESSOAL. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',43,0),(47,47,'tnc_tax_27','Objetos relativos aos mortos e às cerimônias fúnebres. Inclui os respectivos acessórios. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',43,0),(48,48,'tnc_tax_27','Objetos usados para transmitir informações aos seres humanos. Ver também ARTES VISUAIS/CINEMATOGRÁFICA, MEDIÇÃO/REGISTRO/OBSERVAÇÃO/PROCESSAMENTO e TRABALHO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0),(49,49,'tnc_tax_27','Alguns museus não possuem setores de biblioteca e arquivo. Assim, seus livros, periódicos, documentos de arquivo etc. não recebem o tratamento técnico biblioteconômico ou arquivístico condizentes. É para esses museus, sobretudo, que se abriu esta subclasse, que reúne documentos textuais e cartográficos, bem como os iconográficos excluídos da classe ARTES VISUAIS/CINEMATOGRÁFICA. Exclui MATERIAL DE PROPAGANDA. Ver também EQUIPAMENTO DE COMUNICAÇÃO SONORA/VISUAL. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',48,0),(50,50,'tnc_tax_27','Objetos usados na escrita, autenticação, guarda e transporte de documentos textuais, e respectivos acessórios, inclusive os de leitura. Exclui mobiliário. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',48,0),(51,51,'tnc_tax_27','Objetos usados para ampliar, registrar, reproduzir e armazenar sons significativos para a comunicação humana. Inclui ainda os utilizados como sinal visual ou sinalizadores, projetores e visores de imagens, modelos anatômicos e topográficos, globos terrestres e material didático que não se inclua nas demais subclasses do item 10. Ver também DOCUMENTO, EQUIPAMENTO DE TELECOMUNICAÇÃO e INSTRUMENTO MUSICAL. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',48,0),(52,52,'tnc_tax_27','Objetos que facilitem a comunicação à distância, geralmente, por meio de equipamento eletrônico. Ver também EQUIPAMENTO DE COMUNICAÇÃO SONORA/VISUAL. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',48,0),(53,53,'tnc_tax_27','Objetos cuja principal função é a propaganda. Os que cumprem outras funções bem definidas, mas cuja decoração é de caráter propagandístico, serão incluídos nas respectivas classes (ex.: cinzeiro com o nome de um restaurante pertence à subclasse ARTIGO DE TABAGISMO). Ver também EQUIPAMENTO DE ATIVIDADES COMERCIAIS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',48,0),(54,54,'tnc_tax_27','Artefatos que servem como veículo para de passageiros ou carga. Inclui seus acessórios.Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0),(55,55,'tnc_tax_27','Exclui equipamento de comunicação e instrumentos de precisão/ópticos. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',54,0),(56,56,'tnc_tax_27','Exclui equipamento de comunicação e instrumentos de precisão/ópticos. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',54,0),(57,57,'tnc_tax_27','Exclui equipamento de comunicação e instrumentos de precisão/ópticos. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',54,0),(58,58,'tnc_tax_27','Inclui os fluviais. Acrescentar aos descritores abaixo, quando necessário, os termos vela, motor ou misto (vapor/motor e vela) entre parênteses (ex.: Fragata (Vela), Fragata (Motor), Fragata (Mista). Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',54,0),(59,59,'tnc_tax_27','',54,0),(60,60,'tnc_tax_27','',54,0),(61,61,'tnc_tax_27','Objetos criados para servir às necessidades pessoais dos indivíduos, tais como proteção e higiene do corpo, adorno, crença etc. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0),(62,62,'tnc_tax_27','Objetos usados para suster e/ou fixar peças de vestuário ou penteados, mesmo quando fragmentos, adereços de mão e cabeleiras que complementem trajes. Ver também OBJETO DE ADORNO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',61,0),(63,63,'tnc_tax_27','Objetos relacionados ao hábito de fumar, aspirar ou mascar tabaco, outras ervas e drogas. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',61,0),(64,64,'tnc_tax_27','Objetos relacionados à higiene e estética pessoais e aos atos de vestir e calçar. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',61,0),(65,65,'tnc_tax_27','Exclui mobiliário. Ver também OBJETO DE AUXILIO/CONFORTO PESSOAIS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',61,0),(66,66,'tnc_tax_27','Inclui os respectivos acessórios. Ver também ACESSÓRIO DE INDUMENTÃRIA. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',61,0),(67,67,'tnc_tax_27','Objetos criados para suprir deficiências físicas dos seres humanos e/ou para lhes dar maior comodidade, e que não se incluem nas demais subclasses do item 12. Inclui os respectivos acessórios. Ver também ARTIGO DE VIAGEM/CAMPANHA. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',61,0),(68,68,'tnc_tax_27','Objetos usados como símbolos de uma crença, para atrair a sorte ou afastar malefícios, que as pessoas, geralmente, trazem consigo. Ver também OBJETO DE CULTO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',61,0),(69,69,'tnc_tax_27','Objetos usados como vestimentas ou calçados por seres humanos. Inclui, também, as coberturas de cabeça e máscaras que complementem trajes. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',61,0),(70,70,'tnc_tax_27','Objetos usados para infligir penas corporais aos seres humanos ou para a autopenitência. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0),(71,71,'tnc_tax_27','',70,0),(72,72,'tnc_tax_27','',70,0),(73,73,'tnc_tax_27','Objetos usados na medição, registro e observação de fenômenos, substâncias, propriedades, volume e massa, ou ainda para processar dados e ampliar a capacidade visual dos seres humanos. Exclui os de correção de defeitos visuais, como os óculos, e os que registram sons. Inclui os respectivos acessórios. Ver também COMUNICAÇAO e TRABALHO. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0),(74,74,'tnc_tax_27','',73,0),(75,75,'tnc_tax_27','Objetos usados para processar dados por manuais, mecânicos ou eletrônicos. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',73,0),(76,76,'tnc_tax_27','Objetos usados para embalar produtos e mercadorias, e recipientes com função não determinada. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0),(77,77,'tnc_tax_27','Amostras de natureza animal, vegetal ou mineral, em estado bruto ou processadas, desde que não constituam um objeto propriamente dito. Inclui, também, amostras ou fragmentos de rendas, tecidos, couros, cabelos etc., quando não tiverem constituído parte de um objeto ou quando este não pôde ser identificado, e acessórios de artefatos que não puderam ser determinados. Os mostruários para fins comerciais pertencem à subclasse EQUIPAMENTO DE ATIVIDADES COMERCIAIS. Fonte: FERREZ, Helena Dodd; BIANCHINI, Maria Helena S. Thesaurus para acervos museológicos. Ministério da Cultura, Secretaria do Patrimônio Histórico e Artístico Nacional, Fundação Nacional Pró-Memória, Coordenadoria Geral de Acervos Museológicos, 1987.',0,0);
